import React from 'react';

const Product = () => {

    return(
        <div className='product'>
            <div className='product__img'>
                <img src="https://www.bioplanete.com/_Resources/Persistent/59b67c600818922a118e574a1557effa35ae4eec/multi_kuerbiskernoel_geroestet_250ml.jpg" alt="Product"/>
            </div>
            <div className='product__text'>
                <h3 className='product__text-title'>Avocado</h3>
                <p className="product__text-description">
                    some description
                </p>
                <button type='btn'>Details</button>
            </div>
        </div>
    )
}

export default Product;
